import React from 'react';
import './Welcome.css';

function Welcome() {
  return (
    <div className="welcome-container">
      <video className="background-video" autoPlay loop muted>
        <source src="links.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      <div className="welcome-content">
        <h1 className="welcome-title">Welcome to Top Software</h1>
        <p className="welcome-subtitle">
          We build innovative apps and websites to bring your vision to life.
        </p>
        <button className="welcome-button">Learn More</button>
      </div>
    </div>
  );
}

export default Welcome;
